import {useState} from 'react';

const hay = Math.floor(Math.random() * 9);

function Square({value, onSquareClicked}){
  let myValue;
  if(value === null){
    myValue = 'üåæ';
  }else if (value === 'X'){
    myValue = '‚ùå';
  }else{
    myValue = 'üìå';
  }

  return (
    <div>
      <input className="square" type="text" id="name" name="name" required minlength="4" maxlength="8" size="10" />
      {/* <button className='square' onClick={onSquareClicked}>{myValue}</button> */}
    </div>

  )
}


function App() {

  // const [squares, setSquares] = useState(Array(9).fill(null));
  const [row1, setRow1] = useState(Array(5).fill(null));
  const [row2, setRow2] = useState(Array(5).fill(null));
  const [row3, setRow3] = useState(Array(5).fill(null));
  const [row4, setRow4] = useState(Array(5).fill(null));
  const [row5, setRow5] = useState(Array(5).fill(null));

  function handleClick(i){
    const nextSquares = squares.slice();
    if(i === hay){
      nextSquares[i] = "H";
    }else{
      nextSquares[i] = "X";
    }
    setSquares(nextSquares);
  }

  return (
    <>
    <div className="board-row">
      <Square value={row1[0]} onSquareClicked={() => handleClick(0)}/>
      <Square value={row1[1]} onSquareClicked={() => handleClick(1)}/>
      <Square value={row1[2]} onSquareClicked={() => handleClick(2)}/>
      <Square value={row1[3]} onSquareClicked={() => handleClick(3)}/>
      <Square value={row1[4]} onSquareClicked={() => handleClick(4)}/>
    </div>
    <div className="board-row">
      <Square value={row2[0]} onSquareClicked={() => handleClick(0)}/>
      <Square value={row2[1]} onSquareClicked={() => handleClick(1)}/>
      <Square value={row2[2]} onSquareClicked={() => handleClick(2)}/>
      <Square value={row2[3]} onSquareClicked={() => handleClick(3)}/>
      <Square value={row2[4]} onSquareClicked={() => handleClick(4)}/>
    </div>
    <div className="board-row">
      <Square value={row3[0]} onSquareClicked={() => handleClick(0)}/>
      <Square value={row3[1]} onSquareClicked={() => handleClick(1)}/>
      <Square value={row3[2]} onSquareClicked={() => handleClick(2)}/>
      <Square value={row3[3]} onSquareClicked={() => handleClick(3)}/>
      <Square value={row3[4]} onSquareClicked={() => handleClick(4)}/>
    </div>
    <div className="board-row">
      <Square value={row4[0]} onSquareClicked={() => handleClick(0)}/>
      <Square value={row4[1]} onSquareClicked={() => handleClick(1)}/>
      <Square value={row4[2]} onSquareClicked={() => handleClick(2)}/>
      <Square value={row4[3]} onSquareClicked={() => handleClick(3)}/>
      <Square value={row4[4]} onSquareClicked={() => handleClick(4)}/>
    </div>
    <div className="board-row">
      <Square value={row5[0]} onSquareClicked={() => handleClick(0)}/>
      <Square value={row5[1]} onSquareClicked={() => handleClick(1)}/>
      <Square value={row5[2]} onSquareClicked={() => handleClick(2)}/>
      <Square value={row5[3]} onSquareClicked={() => handleClick(3)}/>
      <Square value={row5[4]} onSquareClicked={() => handleClick(4)}/>
    </div>
    </>
  );
}

export default App;
